    message.info(
      `Selected Date: ${value ? value.format("YYYY-MM-DD") : "None"}`
    );
    setDate(value);
  };
  <Row>
    <DatePicker onChange={handleChange} />
    <Col span={6}>
      <Product />
    </Col>
    <Col span={6}>
      <Product />
    </Col>
    <Col span={6}>
      <Product />
    </Col>
    <Col span={6}>
      <Product />
    </Col>
  </Row>;
};

export default Products;
